import React from 'react';
import axios from 'axios';

const baseUrl = 'http://localhost:5000'

class Index extends React.Component {
    constructor(props) {
        super(props)

        axios.get(baseUrl).then((res) => {
            console.log(res.data)
        })

        this.state = {
            users: []
        }
    }

    render() {

    }
}

export default Index
